import React from 'react';
import styled from 'styled-components';

const Ul = styled.ul<{open: boolean}>`
  z-index: 100;
  list-style: none;
  display: flex;
  flex-flow: row nowrap;
  li {
    padding: 18px 3vw;
  }
    flex-flow: column nowrap;
    background-color: #e7a72f;
    position: fixed;
    transform: ${({ open }) => open ? 'translate(0,0)' : 'translate(30px,30px)'};
    top: 17vh;
    right: 4vw;
    height: 80vh;
    width: 300px;
    padding-top: 3.5rem;
    border-radius: 1.1rem;
    transition: all 0.3s linear;
    align-items: 
    li {
      color: #fff;
    }
  
`;

interface RightNavBixoProps {
    open: boolean;
  }

const RightNavBixo = ({ open }: RightNavBixoProps) => {
  return (
    <Ul open={open}>
      <li><a href='/'>Home</a></li>
      <li><a href='/SAEComp'>SAEComp</a></li>
      <li><a href='/Enfases'>ÃŠnfases</a></li>
      <li><a href='/Default'>Notas</a></li>
      <li><a href='/Manual-bixo'>Manual</a></li>
    </Ul>
  )
}

export default RightNavBixo;
